export default function Contact(){
    return(
        <div>
            <p>Phone: 444 444 444</p>
            <p>Email: Someimportant@gmail.com</p>
            <div>
                <a href="https://www.instagram.com/MercedesBenzUSA/"><img className="social-logo" src="./img/instagram.png" alt=""/></a>
            <a href="https://www.facebook.com/mercedesbenzusa"><img className="social-logo" src="./img/facebook.png" alt=""/></a>
            <a href="https://www.youtube.com/mbusa"><img className="social-logo" src="./img/youtube.png" alt=""/></a>
            </div>
        </div>
    )
}
